import FeaturedProductOverview from "../../components/HomePage/featured-product-overview/featured-product-overview.component";
const HomePage = () => {
  return (
    <HomePageContainer>      
      <BannerOverview/>
      <CategoriesSlider />     
      <FeaturedProductOverview />
    </HomePageContainer>
  )
}

export default HomePage
